import React, { Component } from 'react';
import './App.css';

export default class App extends Component {
  btnStyle = {
    color: '#fff',
    border: 'none', 
    padding: '5px 9px',
    borderRadius: '50%',
    cursor: 'pointer', 
    float: 'light'
  }

  render() {
    return (
      <div className='container'>
        <div className='todoBlock'>
          <div className='title'>
            <h1>To do List</h1>
          </div>
          <div>
            <input type = 'checkbox' defaultChecked = {false} />
            공부하기
            <button style = {this.btnStyle}>x</button>
          </div>
        </div>
      </div>
    )
  }
}
